import { useContext, useState } from "react";
import { useNavigate, useParams } from "react-router-dom"
import axios from "axios";
import "./Main.css"
axios.defaults.withCredentials = true;

export function Login(props){
    const REST = process.env.REACT_APP_RESTURL;

    const nav = useNavigate();
    const [id,setId] = useState("");
    const [pwd,setPwd] = useState("");
    const handleSubmit = (e) => {
        e.preventDefault();
        doLogin();
    }
    
    function doLogin(){
    //axios로 로그인 요청, const trylogin = true일때 실행 X, response not ok면 다시 trylogin = false;, ok면 JWT 생성하고 메인으로 이동
        console.log(REST);
        console.log(id);
        console.log(pwd);
        console.log("doLogin");
        axios(`https://${REST}/api/login`, {
            method : "get",
            params : {
                id: id,
                pwd : pwd
            },
            credentials: "include", // 💡 HTTP-Only 쿠키 포함 요청
            withCredentials: true  // 쿠키 및 인증 헤더를 포함하여 요청

        }).then((res) => {
                console.log(res);
                const token = res.headers['authorization'].split(' ')[1];
                console.log(token);
                nav("/");
        }).catch((err) => {
            
            console.log(err.response);
            alert("아이디가 안됨! ");
        });
        
    }
    
    return(
        <div id='Signup'>
        <div className="signup-container">
            <h2>회원가입</h2>
            <form onSubmit={handleSubmit}>
                <div className="input-group">
                    <label htmlFor="id">아이디</label>
                    <input type="text" id="id" value={id} onChange={(e) => setId(e.target.value)} required />
                </div>
                <div className="input-group">
                    <label htmlFor="password">비밀번호</label>
                    <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
                </div>
                <div className="input-group">
                    <label htmlFor="email">이메일</label>
                    <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} />
                </div>
                <div className="input-group">
                    <label htmlFor="nickname">닉네임</label>
                    <input type="text" id="nickname" value={nickname} onChange={(e) => setNickname(e.target.value)} required />
                </div>
                {errorMessage && <div className="error-message">{errorMessage}</div>}
                <button type="submit" className="submit-btn">회원가입</button>
            </form>
        </div>
       
            <div className="Channel">
            <div className="OutputChat">
            <div id="login">
                <div className="Login-container">
                    <form onSubmit={handleSubmit}>
                        <input id="id" required  value = {id} onChange={(e) => setId(e.target.value)}></input> ID <p></p>
                        <input id="pwd" required value ={pwd} onChange={(e) => setPwd(e.target.value)}></input> PWD <p></p>
                        <button type="submit"> go </button>
                    </form>
                    <a href="/register" className="link-btn">회원가입</a>
                    <a href="/find-id" className="link-btn">아이디 찾기</a>
                    <a href="/find-password" className="link-btn">비밀번호 찾기</a>
            </div>
        </div>
        </div>
        </div>
        </div>
    )
}
